CREATE DATABASE IF NOT EXISTS projest;
USE projest;

CREATE TABLE IF NOT EXISTS clientes(
	id_cliente INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(50) NOT NULL,
    endereco VARCHAR(255),
    email VARCHAR(100)
    )
    COMMENT "Tabela que armazena entidades CLIENTES";

CREATE TABLE IF NOT EXISTS projetos(
	id_projeto INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(50) NOT NULL,
    id_cliente INT NOT NULL,
    id_gerente INT NOT NULL,
    valor_orcado DECIMAL(10,2) DEFAULT 0,
    andamento DECIMAL(5,4) DEFAULT 0
    )
    COMMENT "Tabela que armazena entidades PROJETOS";

CREATE TABLE IF NOT EXISTS recursos_fisicos(
	id_rf INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(50) NOT NULL,
    unidade VARCHAR(10) NOT NULL,
    custo_unitario DECIMAL(6,2)
    )
    COMMENT "Tabela que armazena entidades RECURSOS FÍSICOS";
    
CREATE TABLE IF NOT EXISTS uso_rf(
	id_uso_rf INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    id_tarefa INT,
    id_projeto INT NOT NULL,
    id_rf INT NOT NULL,
    quantidade DECIMAL(6,2) NOT NULL,
    data_rf DATE
    )
    COMMENT "Tabela que armazena USOS DE RECURSOS FÍSICOS";
    
CREATE TABLE IF NOT EXISTS tarefas(
	id_tarefa INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(100) NOT NULL
    )
    COMMENT "Tabela que armazena entidades TAREFAS";    
    
CREATE TABLE IF NOT EXISTS pessoas(
	id_pessoa INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(20) NOT NULL,
    sobrenome VARCHAR(20) NOT NULL,
    email VARCHAR(100),
    id_cargo INT NOT NULL
    )
    COMMENT "Tabela que armazena entidades PESSOAS";

CREATE TABLE IF NOT EXISTS cargos(
	id_cargo INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    nome VARCHAR(50) NOT NULL,
    valor_hora DECIMAL(5,2) NOT NULL
    )
    COMMENT "Tabela que armazena entidades CARGOS";
    
CREATE TABLE IF NOT EXISTS uso_rh(
	id_uso_rh INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    id_tarefa INT,
    id_pessoa INT NOT NULL,
    id_projeto INT NOT NULL,
    hora_inicio TIMESTAMP NOT NULL,
    hora_fim TIMESTAMP NOT NULL
    )
    COMMENT "Tabela que armazena registros de tempo de USO DE RECURSOS HUMANOS";

/* Definição das relações entre as tabelas com definição das chaves estrangeiras.
Serão definidas através da alteração de tabelas, pois não foram definidas no momento da criação */

ALTER TABLE projetos ADD CONSTRAINT FOREIGN KEY (id_cliente) REFERENCES clientes(id_cliente);
ALTER TABLE projetos ADD CONSTRAINT FOREIGN KEY (id_gerente) REFERENCES pessoas(id_pessoa);
ALTER TABLE uso_rf ADD CONSTRAINT FOREIGN KEY (id_tarefa) REFERENCES tarefas(id_tarefa);
ALTER TABLE uso_rf ADD CONSTRAINT FOREIGN KEY (id_projeto) REFERENCES projetos(id_projeto);
ALTER TABLE uso_rf ADD CONSTRAINT FOREIGN KEY (id_rf) REFERENCES recursos_fisicos(id_rf);
ALTER TABLE uso_rh ADD CONSTRAINT FOREIGN KEY (id_tarefa) REFERENCES tarefas(id_tarefa);
ALTER TABLE uso_rh ADD CONSTRAINT FOREIGN KEY (id_pessoa) REFERENCES pessoas(id_pessoa);
ALTER TABLE uso_rh ADD CONSTRAINT FOREIGN KEY (id_projeto) REFERENCES projetos(id_projeto);
ALTER TABLE pessoas ADD CONSTRAINT FOREIGN KEY (id_cargo) REFERENCES cargos(id_cargo);

    
	




    

